    "Cokeville Meadows National Wildlife Refuge Proposal : Final Environmental Impact
    Statement",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:05:33.654750",nt"name":
    "cokeville-meadows-national-wildlife-refuge-proposal-final-environmental-impact-statement",nt"isopen":
    false,nt"url": null,nt"notes": "This environmental document assesses the
    potential environmental effects of establishment of a national wildlife refuge for
    the primary purpose of preserving and protecting wetland and riparian habitats for
    their migratory waterfowl and other migratory bird values within a 26,657 acre area
    in Lincoln County, Wyoming. The U.S. Fish and Wildlife Service (Service) would acquire
    the land in fee or easement for management along the Bear River south of the town
    of Cokeville, Wyoming. The environmental document displays four alternatives, including
    a "No Action" alternative. The alternatives describe the level of involvement
    of the Fish and Wildlife Service in management of land to protect valuable wildlife
    and wildlife habitat resources. The Proposed Action would provide an optimum level
    of management through a mix of management activities which would require both fee
    purchase and easement purchases of lands. In acquisition, water rights and mineral
    rights would also be purchased, but all purchases would be negotiated. No condemnation
    of land would occur. Besides the private lands involved, State lands and Bureau
    of Land Management lands would be secured for management by the Service. The Bureau
    of Land Management is designated as a Cooperating Agency under NEPA guidelines because
    of their resource management and public domain lands administrative responsibilities
    within the proposal area and the potential withdrawal of those public domain lands
    for use by the Service.",nt"license_title": "License Not Specified",nt"extras":
